import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { LotService } from '../lot.service';
import { Lot } from '../lot';
import { map, switchMap } from 'rxjs/operators';
import { of } from 'rxjs';
import { ImmeubleService } from 'src/app/immeuble/immeuble.service';
import { CoproprietaireService } from 'src/app/coproprietaire/coproprietaire.service';

@Component({
  selector: 'app-lot-edit',
  templateUrl: './lot-edit.component.html'
})
export class LotEditComponent implements OnInit {

  id!: string;
  lot!: Lot;
  feedback: any = {};
  immeubles: any = [];
  coproprietaires: any = [];



  constructor(
    private route: ActivatedRoute,
    private router: Router,
    private lotService: LotService,
    private immeubleService:ImmeubleService,
    private coproprio:CoproprietaireService) {
  }

  ngOnInit() {
    this
      .route
      .params
      .pipe(
        map(p => p['id']),
        switchMap(id => {
          if (id === 'new') { return of(new Lot()); }
          return this.lotService.findById(id);
        })
      )
      .subscribe({
        next: lot => {
          this.lot = lot;
          this.feedback = {};
        },
        error: err => {
          this.feedback = {type: 'warning', message: 'Error loading'};
        }
      });
  }

  loadImmeubles(){
    this.immeubleService.getList().subscribe({
      next:(data:any)  => {
        this.immeubles = data;
      },
      error: (err:any) => {
      console.log (err)     }
    });
  }

  loadCoprop(){
    this.lotService.getList().subscribe({
      next:(data:any)  => {
        this.lots = data;
      },
      error: (err:any) => {
      console.log (err)     }
    });
  }

  save() {
    this.lotService.save(this.lot).subscribe({
      next: lot => {
        this.lot = lot;
        this.feedback = {type: 'success', message: 'Save was successful!'};
        setTimeout(async () => {
          await this.router.navigate(['/lots']);
        }, 1000);
      },
      error: err => {
        this.feedback = {type: 'warning', message: 'Error saving'};
      }
    });
  }

  async cancel() {
    await this.router.navigate(['/lots']);
  }
}
<ol class="breadcrumb float-right">
  <li class="breadcrumb-item"><a routerLink="/">Accueil</a></li>
  <li class="breadcrumb-item active">Lots</li>
</ol>
<div class="card">
  <div class="header">
    <h2 class="title">Details</h2>
  </div>
  <div class="content">
    <div *ngIf="feedback.message" class="alert alert-{{feedback.type}}">{{ feedback.message }}</div>
    <form *ngIf="lot" #editForm="ngForm" (ngSubmit)="save()">

      <div class="form-group">
        <label>Id</label>
        {{lot.id }} 
      </div>

      <div class="form-group">
        <label for="id_immeuble">Immeuble associé</label>
        <input type="number" [(ngModel)]="lot.id_immeuble" id="id_immeuble" name="id_immeuble" class="form-control">
      </div>
      <div class="form-group">
        <select id="id_lot" class="form-control" >
          <ng-container *ngFor="let immeuble of immeubles">
            <option [value]="immeuble.id">{{lot.nom}}</option>
          </ng-container>
      </select>
    </div>

      <div class="form-group">
        <label for="nom">Nom</label>
        <input [(ngModel)]="lot.nom" id="nom" name="nom" class="form-control">
      </div>

      <div class="form-group">
        <label for="id_coproprio">Propriétaire</label>
        <input type="number" [(ngModel)]="lot.id_coproprio" id="id_coproprio" name="id_coproprio" class="form-control">
      </div>

      <button type="submit" class="btn btn-primary" [disabled]="!editForm.form.valid">Save</button>
      <button type="button" class="btn btn-secondary" (click)="cancel()">Cancel</button>
    </form>
  </div>
</div>
